import React, {Component, Fragment} from 'react';
import { Link } from 'react-router-dom';

import { personToCard } from './PersonFound'

export default class AddMissing extends Component {
  constructor(props) {
    super(props);
    this.state = {...this.props.location.state}
  }
  render() {
    return(
      <div>
        <h2>This person has not yet been checked in</h2>
        <p></p>
          {personToCard(this.state)}
        <p></p>
        <h3>Would you like to start a missing person's entry for them?</h3>
        <p></p>
        <button>Yes</button><Link to="/"><button>No</button></Link>
      </div>
    );
  }
}
